document.addEventListener('DOMContentLoaded', () => {
    const countrySelector = document.getElementById('country-selector');
    const celebrityContainer = document.getElementById('celebrities-swiper').querySelector('.swiper-wrapper');
    const moviesList = document.getElementById('movies-list');
    const modal = document.getElementById('trailer-modal');
    const iframe = document.getElementById('youtube-trailer');
    const statsContainer = document.querySelector('.country-stats-container'); // <-- new

    // Event listener for play trailer button on the country page
    moviesList.addEventListener('click', function (e) {
        if (e.target.classList.contains('play-trailer-btn')) {
            e.preventDefault();
            const movieItem = e.target.closest('.movie-list-item');
            const trailerUrl = movieItem.dataset.trailer;
            if (trailerUrl) {
                iframe.src = trailerUrl;
                modal.style.display = 'block';
            }
        }
    });

    const closeButton = document.querySelector('.close-button');

    // Close modal when the close button is clicked
    closeButton.addEventListener('click', function () {
        modal.style.display = 'none';
        iframe.src = '';
    });

    // Close modal when clicking outside of it
    window.addEventListener('click', function (event) {
        if (event.target == modal) {
            modal.style.display = 'none';
            iframe.src = '';
        }
    });

    const countries = {
        "USA": "United States",
        "UK": "United Kingdom",
        "South Korea": "South Korea",
        "India": "India",
        "France": "France",
        "Japan": "Japan",
        "Germany": "Germany",
        "Italy": "Italy",
        "Canada": "Canada",
        "China": "China"
    };

    function populateDropdown() {
        for (const code in countries) {
            const option = document.createElement('option');
            option.value = code;
            option.textContent = countries[code];
            countrySelector.appendChild(option);
        }
    }

    function renderCountryStats(data) {
        if (!statsContainer) return;
        statsContainer.innerHTML = ''; // clear previous
        if (data && data.CountryName && Array.isArray(data.CountryName) && data.CountryName.length > 0) {
            // use first entry
            const info = data.CountryName[0];
            const name = info.name || '';
            const total = info.Total_Movies || '';
            const html = `
                <div class="country-stats">
                    <h3 class="country-stats-title">${name}</h3>
                    <p class="country-stats-sub">Estimated production: ${total}</p>
                </div>
            `;
            statsContainer.innerHTML = html;
        }
    }

    function updateContent(countryCode) {
        const data = countryData[countryCode];
        if (!data) return;

        // render country stats (new)
        renderCountryStats(data);

        // Update celebrities
        celebrityContainer.innerHTML = '';
        if (Array.isArray(data.celebrities)) {
            data.celebrities.forEach(celebrity => {
                const celebrityElement = document.createElement('div');
                celebrityElement.classList.add('swiper-slide');
                celebrityElement.innerHTML = `
                    <div class="celebrity-card">
                        <img src="${celebrity.image}" alt="${celebrity.name}">
                        <div class="celebrity-name">${celebrity.name}</div>
                    </div>
                `;
                celebrityContainer.appendChild(celebrityElement);
            });
        }

        // Update Highest Paid Actor
        const highestPaidActorContainer = document.getElementById('highest-paid-actor-container');
        if (highestPaidActorContainer) highestPaidActorContainer.innerHTML = '';
        if (data.HighestPaidActor) {
            data.HighestPaidActor.forEach(actor => {
                const actorElement = document.createElement('div');
                actorElement.classList.add('highest-paid-card');
                actorElement.innerHTML = `
                    <img src="${actor.image}" alt="${actor.name}">
                    <div class="celebrity-name visible">${actor.name}</div>
                    <div class="celebrity-earnings">Earnings: ${actor.earnings}</div>
                `;
                highestPaidActorContainer.appendChild(actorElement);
            });
        }

        // Update Highest Paid Actress
        const highestPaidActressContainer = document.getElementById('highest-paid-actress-container');
        if (highestPaidActressContainer) highestPaidActressContainer.innerHTML = '';
        if (data.HighestpaidActress) {
            data.HighestpaidActress.forEach(actress => {
                const actressElement = document.createElement('div');
                actressElement.classList.add('highest-paid-card');
                actressElement.innerHTML = `
                    <img src="${actress.image}" alt="${actress.name}">
                    <div class="celebrity-name visible">${actress.name}</div>
                    <div class="celebrity-earnings">Earnings: ${actress.earnings}</div>
                `;
                highestPaidActressContainer.appendChild(actressElement);
            });
        }

        // Update movies
        moviesList.innerHTML = '';
        if (Array.isArray(data.movies)) {
            data.movies.forEach((movie, index) => {
                const movieElement = document.createElement('div');
                movieElement.classList.add('movie-list-item');
                movieElement.dataset.trailer = movie.trailer || '';
                movieElement.innerHTML = `
                    <div class="movie-list-item-rank">${index + 1}</div>
                    <img src="${movie.image}" alt="${movie.title}" class="movie-list-item-poster">
                    <div class="movie-list-item-details">
                        <h3>${movie.title}</h3>
                        <p>‚≠ê ${movie.rating} | ${movie.genre}</p>
                    </div>
                    <div class="movie-list-item-trailer">
                        <a href="#" class="play-trailer-btn">Play Trailer</a>
                    </div>
                `;
                moviesList.appendChild(movieElement);
            });
        }

        // Re-initialize swiper (destroy if exists)
        try {
            if (window._countryCelebSwiper && typeof window._countryCelebSwiper.destroy === 'function') {
                window._countryCelebSwiper.destroy(true, true);
            }
        } catch (e) { /* ignore */ }

        window._countryCelebSwiper = new Swiper('#celebrities-swiper', {
            slidesPerView: 5,
            spaceBetween: 15,
            navigation: {
                nextEl: '.swiper-button-next',
                prevEl: '.swiper-button-prev',
            },
            breakpoints: {
                480: { slidesPerView: 2 },
                768: { slidesPerView: 3 },
                1024: { slidesPerView: 4 },
            }
        });
    }

    countrySelector.addEventListener('change', (event) => {
        updateContent(event.target.value);
    });

    populateDropdown();
    // Initial load
    updateContent('USA');
});
